  fullName: SuperOffice.Threading.IDelayedAsyncQueue<TItem>.Requeue(SuperOffice.Threading.IAsyncQueueProcessItemContext<SuperOffice.Threading.DelayedItem<TItem>>, System.Threading.Tasks.Task)
  type: Method
  assemblies:
  - SoCore
  namespace: SuperOffice.Threading
  summary: Add back the item being processed to the end of queue, for a retry attempt
  remarks: >-
    This method is intended to be called from within the <xref href="SuperOffice.Threading.AsyncQueueProcessItemAsync%601" data-throw-if-not-resolved="false"></xref> delegate.

    When an item is being processed, it is removed from the queue and added to a currently being processed list.

    When processing has been completed, it is removed from this list as well.  When

    WaitForItemsInQueueToBeProcessedAsync is calledm, it waits for all items in the queue and items being processed.

    We thus need to add the item back in the queue, without the internal signaling task comleting, so we ignore retry attempts when waiting.
  example: []
  syntax:
    content: void Requeue(IAsyncQueueProcessItemContext<DelayedItem<TItem>> context, Task prerequisiteTask)
    parameters:
    - id: context
      type: SuperOffice.Threading.IAsyncQueueProcessItemContext{SuperOffice.Threading.DelayedItem{{TItem}}}
      description: Context that needs the be requeued
    - id: prerequisiteTask
      type: System.Threading.Tasks.Task
      description: Task that must be completed before the item is processed again.
    content.vb: Sub Requeue(context As IAsyncQueueProcessItemContext(Of DelayedItem(Of TItem)), prerequisiteTask As Task)
  overload: SuperOffice.Threading.IDelayedAsyncQueue`1.Requeue*
  nameWithType.vb: IDelayedAsyncQueue(Of TItem).Requeue(IAsyncQueueProcessItemContext(Of DelayedItem(Of TItem)), Task)
  fullName.vb: SuperOffice.Threading.IDelayedAsyncQueue(Of TItem).Requeue(SuperOffice.Threading.IAsyncQueueProcessItemContext(Of SuperOffice.Threading.DelayedItem(Of TItem)), System.Threading.Tasks.Task)
